INSERT INTO `event` (`idevent`, `name`, `description`, `logo`, `start`, `end`, `enabled`, `signstart`, `signend`, `location_idlocation`, `unsignend`, `minimumusers`, `memberprice`, `notmemberprice`, `noshowprice`, `logo_idlogo`, `canrequestpartner`, `canrequestvegetarian`, `showattending`) VALUES
(439, 'Olympicsc', 'Er du til fest, farver og fibersprængninger?  <b>Så deltag i OlympiCSC!  </b>\n\n<b><br/></b>\n\nOlympiCSC afholdes lørdag den 21. august 2010 her på SC. Du skal blot tilmelde dig samt vælge, hvilke aktiviteter du ønsker, at deltage i.\n\n Husk det skal ske inden den 27. maj 2010! Dette er vigtigt for den videre planlægning. Deltagelse koster 100,- for medlemmer af Personaleforeningen. Beløbet vil blive trukket over lønnen derfor skal personalenummer udfyldes. Deltagelse for ikke medlemmer koster 550,- som skal afregnes ved tilmelding. Ved afbud/udeblivelse betales 400,-  I arrangementet indgår følgende:  \n\n=Sport og leg i rigelige mængder\n=1 hold T-shirt.\n=Morgenmad\n=Frokost\n=Festmiddag inkl. vin til maden.\n=Øl / sodavand i løbet af dagen  \n\nTilmeld dig nu og gør dit til, at vi får det lige så sjovt, som vi plejer.\n\nVi ses / OlympiCSC Komiteen - Personaleforeningen\n\n', NULL, '2010-08-21 08:45:00', '2010-08-21 23:59:00', 1, '2010-04-15 12:00:00', '2010-06-03 12:00:00', 103, '2010-06-30 12:00:00', NULL, 100, 550, 400, 8, 0, 0, 0),
(450, 'Grillfest', 'Så er det tid til årets store traditionsrige grillfest på terrassen.\n\n \n\n<b>Fredag d. 18. juni kl18.30</b>\n\n<b><br/></b>\n\nDer vil være grillbuffet med 8-10 forskellige slags kød \\+ pølser.\n\nSlagteren i Lystrup kommer med den store grill og sætter den op på terrassen. Han vil grille fra store bøffer af 8-10 forskellige slags kød og pølser med tilbehør.\n\nPersonaleforeningen vil servere kolde fadøl og vin.\n\nPrisen for hele dette traktement er en flad 50''er.\n\n', NULL, '2010-06-18 18:00:00', '2010-06-18 23:00:00', 1, '2010-05-21 12:00:00', '2010-06-11 12:00:00', 109, '2010-06-15 12:00:00', NULL, 50, 200, 200, 15, 1, 1, 0),
(451, 'DHL ', 'CSC Scandihealth idrætsforening står for arrangementet. <br/>Max. 50 kan deltage. Først til mølle.\n\n', NULL, '2010-08-17 12:00:00', '2010-08-17 12:00:00', 1, '2010-06-06 12:00:00', '2010-07-31 12:00:00', 110, '2010-06-14 12:00:00', NULL, 0, 135, 135, 16, 0, 0, 0);
